function init() {
    window.requestAnimationFrame(() => draw(0));
}

function coords(i, j) {
    return [i * scale + 10, j * scale + 10]
}

function drawArrow(i, j, myAngle) {
    myAngle += Math.random() * Math.PI * 2 / 10;
    [x, y] = coords(i, j);
    ctx.fillStyle = 'black';
    ctx.save()
    ctx.translate(x, y);
    ctx.rotate(myAngle);
    ctx.translate(-x, -y)

    ctx.moveTo(x, y);
    ctx.lineTo(x - 10, y + 10);
    ctx.lineTo(x + 10, y + 10);
    ctx.fill();
    ctx.restore();
    
}

function drawObstacle(i, j) {
    ctx.fillStyle = 'red';
    [x, y] = coords(i, j);
    ctx.fillRect(i * scale + 5, j * scale + 5, 10, 10);
}

function drawTrail(i, j) {
    ctx.fillStyle = 'black';
    [x, y] = coords(i, j);
    ctx.fillRect(i * scale + 8, j * scale + 8, 3, 3);
}


let angle = 0;

function draw(t) {
    ctx.clearRect(0, 0, 600, 600); // clear canvas
    ctx.reset();
    let obstacles = data.obstacles;
    for (let k = 0; k < obstacles.length; k++) {
	[ii, jj] = obstacles[k]
	drawObstacle(ii, jj);	
    }
    let i, j, m, n, o, p;
    if (0 <= t <= data.path.length - 1) {
	for (let prev = 0; prev < t; prev ++) {
	    [i, j, k, l] = data.path[prev];
	    drawTrail(i, j)
	}
	[i, j, k, l] = data.path[t];
	if (t >= 1) {
	    [m, n, o, p] = data.path[t - 1];
	    if (o != k || p != l) {
		angle +=  Math.PI / 2;
		console.log("Turned!", angle);

	    }
	} 
	drawArrow(i, j, angle);
	setTimeout(() => draw(t + 1), 100);
    }
}

init();
